const axios = require("axios");

axios({
    "method":"GET",
    "url":"https://travelopro2.p.rapidapi.comhttps//www.travelopro.com/about.php",
    "headers":{

    "x-rapidapi-host":"travelopro2.p.rapidapi.com",
    "x-rapidapi-key":"c573d899fbmsh7f790eccbfa07a7p17edf7jsnf6b3cf11be53",
    "useQueryString":true
    }})
  .then((data) => {
    console.log(data);
  })
  .catch((error) => {
    console.log(error);
  });
